import React, { useEffect, useState } from 'react';
import { Job } from './components/Job';
import dataJob from './data/data.json';

export const JobListingApp = () => {


    const [jobList, setJobList] = useState([]);
    
    
    useEffect(() => {
        
        setJobList(dataJob);

    }, []);

    
    return (
        <div>
            
            {
                jobList.map(jobs => {
                    
                    <Job key={jobs.id}  job={jobs} />
                })
            }
        
    
        </div>
    )
}
